import React from 'react';
import './Contact.css';
// import contactImg from "./img/about-9.jpg"
import contactImg from'../Img/roundedpic.png'
function Contact() {
    return (
        <div className="contact component__space" id="Contact">
            <div className="row">
                {/* <div className="col__2"> */}
                    <div className="contact__box">
                        <div className="contact__meta">
                            <h1 className="hire__text">Contact me.</h1>
                            <p className="hire__text white">Have an idea?</p>
                           <p className="hire__text white">Let's make something great!</p>
                        </div>
                        <div className="input__box">
                           <input type="text" className="contact name" placeholder="Your name *" />
                           <input type="text" className="contact email" placeholder="Your Email *" />
                           <input type="text" className="contact subject" placeholder="Write a Subject" />
                           <textarea name="message" id="message" placeholder="Write Your message"></textarea>
                           <button className="btn contact pointer" type="submit">Submit</button>
                        </div>
                    </div>
                {/* </div> */}
                {/* <div className="col__2"> */}
                    {/* <img src={contactImg} alt="" className="contact__img" /> */}
                    <p className="hire__text white">I am available for freelance work. Connect with me via phone:</p>
                           <p className="hire__text white"><strong>+91-8302880785</strong> or email <strong>lokesh15mca@gmail.com</strong></p>
                {/* </div> */}
            </div>
        </div>
    )
}

export default Contact
